<!DOCTYPE html>

<head>
    <title>Eden - Parallax Demo</title>
    <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
    <script src="https://unpkg.com/popper.js@1"></script>
    <script src="https://unpkg.com/tippy.js@5"></script>
    <link rel="stylesheet" href="https://unpkg.com/tippy.js@5/dist/backdrop.css" />
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/tippy.js/2.5.3/themes/light.css" />
    <script type="text/javascript" src="data.js"></script>
    <style>
        :root {
            --low: #2C3531;
            --midLow: #116466;
            --mid: #D9B08C;
            --midHigh: #FFCB9A;
            --high: #D1E8E2;

            --opacity: 0;
            background: var(--low);
        }

        * {
            color: var(--high);
            font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;

            margin: 0;
            padding: 0;
        }

        .images {
            position: relative;
        }

        .cryptomatte>div {
            transform-origin: 0 0;
            /* cursor: pointer; */
        }


        .images img {
            position: absolute;
            width: auto;
            height: 80vh;
            cursor:pointer;
        }


        .floor {
            top: 757px;
            z-index: 0;
            opacity: var(--opacity);
        }

        .floorbox {
            top: 807px;
            left: 438px;
            z-index: 5;
            opacity: var(--opacity);
        }

        .occludingbox {
            top: 680px;
            left: 421px;
            z-index: 6;
            opacity: var(--opacity);
        }

        .person {
            top: 541px;
            left: 471px;
            z-index: 4;
            opacity: var(--opacity);
        }

        .topbox {
            top: 0;
            left: 435px;
            z-index: 4;
            opacity: var(--opacity);
        }

        .trees {
            top: 70px;
            left: 0;
            z-index: 2;
            opacity: var(--opacity);
        }


        .sidebar {
            background: var(--midLow);

            width: 25%;
            height: 100vh;
            float: right;
        }

        .sidetext {
            text-align: center;
        }
    </style>
    <script>

        // Canvas and images
        const ctx = document.createElement("canvas").getContext("2d");
        var images = [];

        // Ready functions
        $(function () {
            for (const [index] of Object.entries(data)) {
                var filePath = data[index].file;
                var link = data[index].link;


                $(".images").append(`<div class="${index}" style="opacity:100" data-link="${link}" data-tippy-content="${index}"></div>`)
                $(`.${index}`).append(`<img src="${filePath}" alt="">`)
            }

            //tippy('[data-tippy-content]', { followCursor: false, trigger: 'click' });

            // Add click to each image
            $(".images img").on("click", img => getNonTransparentImage(img, img.currentTarget));

        })


        function getNonTransparentImage(elem, target) {
            if (!target.offsetParent) return;

            // Get click coordinates
            const isImage = /img/i.test(target.tagName),
                x = elem.pageX - target.offsetParent.offsetLeft,
                y = elem.pageY - target.offsetParent.offsetTop,
                w = ctx.canvas.width = target.width,
                h = ctx.canvas.height = target.height;

            // Draw image to canvas and read Alpha channel value
            var alpha;
            if (isImage) {
                ctx.drawImage(target, 0, 0, w, h);
                // Returns RGBA values
                // https://developer.mozilla.org/en-US/docs/Web/API/ImageData/ImageData
                alpha = ctx.getImageData(x, y, 1, 1).data[3];
            }


            /* 
            * If the clicked pixel's alpha is 0
            * then hide the image and push it to image stack.
            */


            if (alpha === 0) {
                //Hide image  
                    
                target.hidden = 1
                // Push to images array       
                images.push(target);


                // recursive function  
                // Get element at clicked position
                var clickedElem = document.elementFromPoint(elem.clientX, elem.clientY);
                return getNonTransparentImage(elem, clickedElem);
            } else {

                // Else, we have clicked on non tranparent part of the image
                // So find image in the list and set it to visible
                images.forEach(el => {
                    el.hidden = 0
                });

                // Reset images
                images = [];

                // Get text from data-tippy, can change this as making tippy work would need some more work, especially follow
                var elemText = $(target).parent().attr("data-tippy-content");
                
                // If no data tippy content, reset to placeholder
                elemText = !!elemText ? elemText : 'Placeholder';
                $('.sidetext').text(elemText);

                // Show link in the sidepanel if there is one
                var link = $(target).parent().attr("data-link");
                var linkElem = $(".link span");
                if(link !== 'undefined'){
                    $(linkElem).html(`<a target="_blank" href="${link}">Link for ${elemText}</a>`).show();
                } else {
                    $(linkElem).hide();
                }                
            }
        }

    </script>


</head>
